import React from 'react'
import './socialNetworkCSS.css'


function socialNetwork() {
    return (
        <div className='socialNetworkDiv'>
            <div className='socialText'>SOCIAL NETWORK</div>
            <ul>
                <li>
                    <a href="#"><i class="fa fa-facebook icon"></i></a>
                </li>
                <li>
                    <a href="#"><i class="fa fa-twitter icon"></i></a>
                </li>
                <li>
                    <a href="#"><i class="fa fa-instagram icon"></i></a>
                </li>
                <li>
                    <a href="#"><i class="fa fa-pinterest icon"></i></a>
                </li>
            </ul>

        </div>
    )
}

export default socialNetwork
// {<a href="#" alt='Facebook' class="fa fa-facebook icon"></a>
